mapper.select:
SELECT       
    "fujoShuruiCode"     
FROM       
    rgur."UrT0526SeikatsuHogoFujoShurui"      
WHERE       
    "UrT0526SeikatsuHogoFujoShurui"."shikibetsuCode" = #{shikibetsuCode} 
   AND "UrT0526SeikatsuHogoFujoShurui"."gyomuCode" = #{gyomuCode}   
   AND "UrT0526SeikatsuHogoFujoShurui"."jukyuKaishiYMD" = #{jukyuKaishiYMD}
ORDER BY 
  "UrT0526SeikatsuHogoFujoShurui"."shikibetsuCode" ASC, "UrT0526SeikatsuHogoFujoShurui"."fujoShuruiCode" ASC
